import React from 'react';
import logo from './logo.svg';
import './App.css';
import Header from './components/header.component';

function App() {
  return (
    <div className="App">
        <Header/>
        <div class="container">
            <div class="row">
                <div class="col-md">
                One of three columns
                </div>
                <div class="col-md">
                One of three columns
                </div>
            </div>
        </div>
    </div>
  );
}

export default App;
